  - uid: 920
    components:
    - type: MetaData
      name: Мемуары призрака
    - type: Transform
      pos: -19.514713,-29.354633
      parent: 2
    - type: Paper
      content: >
        Я - автор этого рассказа, хочу представить вам историю от лица самого себя, попавшего в пространство после смерти - Лимбо.


        Понимаю, что это может звучать немного странно, но в данном контексте, я рассказываю историю о себе из фантастической перспективы. Я умираю, и моя душа оказывается в Лимбо - неопределенном пространстве после смерти.


        Лимбо представлен как обычные места - отделы, дормы и простые коридоры. Но что ещё удивительнее, вокруг меня находятся другие люди, попавшие сюда также не по своей воле. Мы все здесь, но никогда не знаем, кто из нас здесь, и кто уже перешел дальше.


        Спокойствие и тишина в Лимбо поразительны. Все здесь занимаются своими делами, как будто это обычная жизнь. Мы говорим, общаемся, но никогда не понимаем, что ждет нас дальше.


        Но, несмотря на это спокойствие, я теряю смысл своего существования. Понимая, что я останусь здесь навечно, все мои воспоминания о мире, о жизни, о любви, становятся еще более грустными и печальными. Я понимаю, что ничего больше не достигну, что не смогу изменить свою судьбу.


        В Лимбо, я стал свидетелем того, как люди пытаются найти смысл в своей бессмысленной жизни. Может, я схожу с ума?
